import { useOrganization, useUser } from '@clerk/clerk-react';
import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import './ExpenseList.css';

const GroupDetails = () => {
  const { orgId } = useParams();
  console.log('Current orgId:', orgId);

  const { 
    organization, 
    isLoaded: isOrgLoaded,
    memberships,
    invitations
  } = useOrganization({ 
    organizationId: orgId,
    memberships: { infinite: true },
    invitations: { infinite: true }
  });

  const { user, isLoaded: isUserLoaded } = useUser();
  const [expenses, setExpenses] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      if (!organization || !user) {
        console.log('Missing required data:', {
          organization: !!organization,
          user: !!user
        });
        return;
      }

      try {
        setLoading(true);
        const apiUrl = `http://localhost:3005/api/groups/${orgId}/member-details`;
        console.log('Fetching from:', apiUrl);

        const response = await fetch(apiUrl);
        console.log('API Response:', {
          status: response.status,
          statusText: response.statusText,
          ok: response.ok
        });

        if (!response.ok) {
          const errorText = await response.text();
          console.error('API Error Response:', errorText);
          throw new Error(`Failed to fetch member details: ${response.status} ${response.statusText}`);
        }

        const data = await response.json();
        console.log('Received member data:', data);

        if (!Array.isArray(data)) {
          console.error('Unexpected data format:', data);
          throw new Error('Received invalid data format from server');
        }

        setExpenses(data);
      } catch (err) {
        console.error('Error fetching member details:', err);
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    if (isOrgLoaded && isUserLoaded && orgId) {
      fetchData();
    }
  }, [organization, user, isOrgLoaded, isUserLoaded, orgId]);

  if (loading) {
    return <div className="expense-list-container">Loading group details...</div>;
  }

  if (error) {
    return (
      <div className="expense-list-container">
        <h1>Error</h1>
        <p className="subtitle">{error}</p>
      </div>
    );
  }

  return (
    <div className="expense-list-container">
      <h1>{organization?.name}</h1>

      {/* Group Stats */}
      <div className="group-info">
        <p className="subtitle">Active Members: {memberships?.data?.length || 0}</p>
        <p className="subtitle">Pending Invites: {invitations?.data?.length || 0}</p>
        <p className="subtitle">Your Role: {organization?.membership?.role}</p>
      </div>

      {/* Member Expenses Section */}
      <div className="expense-list">
        <h2>Member Expenses</h2>
        {expenses.length === 0 ? (
          <p className="subtitle">No expenses found for this group.</p>
        ) : (
          expenses.map((expense) => (
            <div key={expense.id} className="expense-item">
              <div className="expense-info">
                <h3>{expense.description}</h3>
                <p>Amount: ${parseFloat(expense.amount).toFixed(2)}</p>
                <p>Date: {new Date(expense.date).toLocaleDateString()}</p>
                <p>Paid by: {memberships?.data?.find(m => m.publicUserData.userId === expense.paid_by_user_id)?.publicUserData.identifier || 'Unknown'}</p>
              </div>
            </div>
          ))
        )}
      </div>
    </div>
  );
};

export default GroupDetails;
